import React from 'react';
import './css/budgetingPage.css'; // Make sure this path is correct

function BudgetingPage({ onBackClick }) {
  // Confirm that onBackClick is a function before rendering
  if (typeof onBackClick !== 'function') {
    console.error('BudgetingPage expects a function for onBackClick prop.');
    return null;
  }

  return (
    <div>
      <h2>Budgeting Resources</h2>
      {/* Your BudgetingPage content goes here */}
      <button onClick={onBackClick}>Back to Resources</button>
    </div>
  );
}

export default BudgetingPage;
